export default function OperatorCard() {
    return (
        <div className="OperatorCard">
            <div className="card-grid">
                <h3 id="Name">Ace</h3>
                <img id="Portrait" alt="Ace" src="images/ops/portraits/ace.webp" />
            </div>
            <img id="Faction" alt="Attack" src="images/ui/attack.webp" />
            <img id="Badge" alt="Ace" src="images/ops/icons/ace.png" />
        </div>
    )
}
